import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello, World!</h1>
        <h2>It is {new Date().toLocaleTimeString()}.</h2>
      </header>
    </div>
  );
  setInterval(App, 1000);
}

export default App;
